pragma solidity ^0.4.24;

import "./Party.sol";

/**
 * This is responsible for deploying a new Party.
 */
contract Deployer {
    /**
     * Address of Overlord contract.
     */
    address public overlord;

    /**
     * Notify that a new party has been deployed.
     */
    event Deployed(
        address indexed deployedAddress,
        address indexed deployer
    );

    /**
     * Constructor.
     */
    constructor(address _overlord) public {
      overlord = _overlord;
    }

    /**
     * Deploy a new contract.
     */
    function deploy(
      string _name,
      uint256 _deposit,
      uint _limitOfParticipants,
      uint _coolingPeriod,
      string _encryption
    ) external {
        Party p = new Party(
          msg.sender,
          _name,
          _deposit,
          _limitOfParticipants,
          _coolingPeriod,
          _encryption
        );

        emit Deployed(p, msg.sender);
    }

    /**
     * Don't allow arbitrary calls
     */
    function () public {
        revert();
    }
}
